          "description": "Since the first edition of this established text was published in 1988, action research has gained ground as a popular method amongst educational researchers, and in particular for practising teachers doing higher-level courses. In this new edition Jean McNiff provides updates on methodological discussions and includes new sections of case study material and information on supporting action research. The book raises issues about how action research is theorised, whether it is seen as a spectator discipline or as a real life practice, and how practitioners position themselves within the debate. It discusses the importance for educators of understanding their own work and showing how their educative influence can lead to the development of good orders in formal and informal learning settings and in the wider community. This second edition comes at a time when, after years of debate over what counts as action research, it is now considered an acceptable and useful part of mainstream research practice.",
