          "description": "Application developers love MongoDB, a document-oriented NoSQL database, for its speed, flexibility, scalability, and ease of use. MongoDB is well-suited as a back-end for modern web applications. Its schema-free design encourages rapid application development, and built-in replication and auto-sharding architecture allow for massive parallel distribution. Production deployments at SourceForge, Foursquare, and Shutterfly demonstrate daily that MongoDB is up to real-world challenges. MongoDB in Action, Second Edition is a comprehensive guide to MongoDB version 2.6. It begins with a general overview of current database systems, explaining what makes MongoDB unique and describing its ideal use cases. Then, a series of tutorials lead into detailed examples for leveraging MongoDB in e-commerce, social networking, and other common applications. A reference section on schema design patterns helps ease the transition from the relational data model of SQL to MongoDB's document-based data model. Purchase of the print book comes with an offer of a free PDF, ePub, and Kindle eBook from Manning. Also available is all code from the book.",
