          "description": "Apabila kamu ingin sungguh-sungguh belajar, maka kamu memerlukan contoh yang terbaik. Kisah hidup, perjuangan, kerja keras, dilema dan keputusan besar yang diambil oleh orang-orang hebat ini telah menginspirasi dan menggerakkan banyak orang. Figur-figur yang mencapai impiannya dengan penuh perjuangan adalah aset karakter bagi generasi kini dan yang akan datang. Salah satu aset karakter itu kini ada juga di Bali. Di tengah gejolak zaman yang makin garang, di mana anak-anak muda kehilangan karakter, kamu masih bisa belajar dari tokoh-tokoh hebat yang telah berproses lebih dulu. Anak-anak muda kini memerlukan mentor yang tepat dan tempat yang tepat untuk belajar dan mengambil teladan. Orang-orang hebat itu bisa jadi salah satu panutanmu. Buku kecil ini mencatat best practices, kesan-kesan pengalaman alur kehidupan Prof. Gede Sri Darma, rektor dan profesor termuda yang pernah dimiliki Bali dan Indonesia. Kamu yang mulai putus asa, kehilangan harapan dan patah semangat bisa membaca kisah hidupnya yang penuh intrik dan suka-duka. Dari sana, kamu bisa sadar bahwa selalu ada harapan di balik setiap peristiwa kelam dalam hidupmu. Jadi, bangkitlah lagi dan belajarlah!",
