          "publishedDate": "2007-12-01",
          "description": "“A memorable and vivid history lesson about a remote mysterious place that, in terms of its sheer survival, has implications for our own lives.” —The Times-Picayune Over the course of three years, journalist Thomas Laird spent more than sixty hours with His Holiness the Dalai Lama in candid, one-on-one interviews that ranged widely, covering not only the history of Tibet but science, reincarnation, and Buddhism. Laird brings these meetings to life in this vibrant, monumental work that outlines the essence of thousands of years of civilization, myth, and spirituality. Tibet’s story is rich with tradition and filled with promise. It begins with the Bodhisattva Chenrizi (“The Holy One”) whose spirit many Tibetans believe resides within the Dalai Lama. We learn the origins of Buddhism, and about the era of Great Tibetan Emperors, whose reign stretched from southwestern China to Northern India. His Holiness introduces us to Tibet’s greatest yogis and meditation masters, and explains how the institution of the Dalai Lama was founded. Laird explores, with His Holiness, Tibet’s relations with the Mongols, the Golden Age under the Great Fifth Dalai Lama, Tibet’s years under Manchu overlords, modern independence in the early twentieth century, and the Dalai Lama’s personal meetings with Mao just before His Holiness fled into exile in 1959. The Story of Tibet is “a tenderly crafted study that is equal parts love letter, traditional history and oral history” (Publishers Weekly). “Captivating reading.” —Tricycle",
