          "description": "The Taming of the Demons examines mythic and ritual themes of violence, demon taming, and blood sacrifice in Tibetan Buddhism. Taking as its starting point Tibet's so-called age of fragmentation (842 to 986 C.E.), the book draws on previously unstudied manuscripts discovered in the \"library cave\" near Dunhuang, on the old Silk Road. These ancient documents, it argues, demonstrate how this purportedly inactive period in Tibetan history was in fact crucial to the Tibetan assimilation of Buddhism, and particularly to the spread of violent themes from tantric Buddhism into Tibet at the local and the popular levels. Having shed light on this \"dark age\" of Tibetan history, the second half of the book turns to how, from the late tenth century onward, the period came to play a vital symbolic role in Tibet, as a violent historical \"other\" against which the Tibetan Buddhist tradition defined itself. -- Georges Dreyfus",
