          "publisher": "ANU E Press",
          "publishedDate": "2008-04-01",
          "description": "\"This thesis is a study of traditional narratives which are recited and received both by villagers and pilgrims in regard to the local pilgrimage (ziarah) tradition in Pamijahan, particularly at Shaykh Abdul Muhyi's sacred site. The narratives will be examined as part of the popular beliefs of Priangan Timur or the eastern part of West Java. Locating them in the wider context of Sundanese oral and written traditions, my investigation will illuminate the nature and function of such traditions in the particular case of Pamijahan. The research will elucidate the role of the kuncen, the custodians of sacred sites, as guides and spiritual brokers who maintain the narratives. It will also be important to investigate the villagers' as well as visitors' view of the kuncen in regard to local pilgrimage. The study will also enhance comparative studies concerned with networks of holy men or saints (wali) on the island of Java (Pemberton 1994; Fox 1991: 20). I want to argue that people respond to, and participate in, saint veneration on pragmatic grounds. However, these grounds are subject to interpretation and contestation in time and space. In redefining their narratives, various individuals, such as custodians, Sufis, and even to some extent government functionaries, are considered to be authoritative persons by virtue of their capacity to conduct and manipulate narratives. As this argument develops, it will be important to understand the modes of signification in the village.\"--Provided by publisher.",
