          "description": "Striking a perfect balance between heartfelt emotions and spot-on humor, this debut features a pop-culture enthusiast protagonist with an unforgettable voice sure to resonate with readers. Alice had her whole summer planned. Nonstop all-you-can-eat buffets while marathoning her favorite TV shows (best friends totally included) with the smallest dash of adulting—working at the library to pay her share of the rent. The only thing missing from her perfect plan? Her girlfriend (who ended things when Alice confessed she's asexual). Alice is done with dating—no thank you, do not pass go, stick a fork in her, done. But then Alice meets Takumi and she can’t stop thinking about him or the rom com-grade romance feels she did not ask for (uncertainty, butterflies, and swoons, oh my!). When her blissful summer takes an unexpected turn and Takumi becomes her knight with a shiny library-employee badge (close enough), Alice has to decide if she’s willing to risk their friendship for a love that might not be reciprocated—or understood. Claire Kann’s debut novel Let’s Talk About Love, chosen by readers like you for Macmillan's young adult imprint Swoon Reads, gracefully explores the struggle with emerging adulthood and the complicated line between friendship and what it might mean to be something more. Praise for Let’s Talk About Love from the Swoon Reads community: “A sweet and beautiful journey about self-discovery and identity!” —Macy Filia, reader on SwoonReads.com “There aren't many novels that have asexual characters and it's something people need more of.” —Alice, reader on SwoonReads.com “I want this on my shelf where I can admire it every day.” —Kiara, reader on SwoonReads.com",
