          "description": "Based on the available information and the data hitherto collected, my hypothesis is that the further I stay away from love, the better off I will be. 'Contemporary romance's unicorn: the elusive marriage of deeply brainy and delightfully escapist.' Christina Lauren, New York Times bestselling author of The Unhoneymooners * When a fake relationship between scientists meets the irresistible force of attraction, it throws one woman's carefully calculated theories on love into chaos. As a third-year Ph.D. candidate, Olive Smith doesn't believe in lasting romantic relationships but her best friend does, and that's what got her into this situation. Convincing Anh that Olive on her way to a happily ever after was always going to be tough, scientists require proof. So, like any self-respecting woman, Olive panics and kisses the first man she sees. That man is none other than Adam Carlsen, a young hotshot professor and well-known ass. Which is why Olive is positively floored when he agrees to keep her charade a secret and be her fake boyfriend. But when a big science conference goes haywire and Adam surprises her again with his unyielding support (and his unyielding abs), their little experiment feels dangerously close to combustion. Olive soon discovers that the only thing more complicated than a hypothesis on love is putting her own heart under the microscope. What the five star reviews are saying about The Love Hypothesis: 'Did I read this in 24 hours? Yes.' 'Funny. Snarky. Intelligent. Real.' 'If you're even slightly thinking about getting this book to read, just go a head and do it' 'Adam is just *swoon*' 'Ali Hazelwood has made herself an auto-buy author' 'It was just... perfect.' 'A heroine you will instantly fall in love with'",
