          "publisher": "Serpent's Tail",
          "publishedDate": "2022-08-04",
          "description": "'This is a book about the untidy, complicated underbelly of love and love's end. Funny and true, wise and utterly authentic, you will recognise yourself over and over. I loved it.' Kit de Waal Did you mean to marry me? Did you understand the vows that we took? J's wife has left, and J is trying to understand why. How could someone you loved so much, who claimed to love you once, just walk away? How could they send divorce papers accusing you of terrible things, when all you've ever done is tried to make them happy? Narrated by J in the days, weeks and months after the marriage collapses, and interspersed with the departed wife's diary entries, Is This Love? is an addictive, deeply unsettling, and provocative novel of deception and betrayal, and passion turned to pain. As the story unfolds, and each character's version of events undermines the other, all our assumptions about victimhood, agency, love and control are challenged - for we never know J's gender. If we did, would it change our minds about who was telling the truth?",
