          "description": "Have you ever heard of the comparison between insanity and love? They have very similar qualities at times. Swaizi Vaughan Ellis is a Texas born model and contemporary poet. She began writing songs at a very young age and as she began to understand herself more, within love and heartbreak, she evolved these journal entries into poems. “Love’s Lobotomy” is her debut as an author. Within this thought provoking collection of poems she expresses all the feelings she felt for men who she loved and experienced at one time or another. This book took Swaizi almost six years to complete. She reminisces her first love, describes polarizing infatuations, and also paints a vivid picture of her desperate need to fall out of love. Within her poems she often combines the senses and personifies the universe, this creates an unexpected image challenging average thought, for example giving color to emotions. Stylishly playing with the idea of being able to surgically rid herself of love this book can resonate with anyone who has experienced such a powerful sentiment.",
