          "description": "Making Numbers Count is a lively, practical, first-of-its-kind guide to turning cold, clinical data into a memorable story. __________ How many hours' worth of songs are on your Spotify Wrapped this year? How much is your commute time really worth? How do you work out how likely you are to get Covid based on the official statistics? How do your viewing hours track against the most popular shows on Netflix? Whether you're interested in global problems like climate change, and understanding that the Australian wildfires destroyed an area twice the size of Portugal, or just grasping how few people have washed their hands between visiting the bathroom and touching your hands, this book will help math-lovers and math-haters alike translate the numbers that animate our world. Until very recently, most languages had no words for numbers greater than five - anything from six to infinity was known as 'lots'. While the numbers in our world have become increasingly complex, our brains are stuck in the past. Yet the ability to communicate and understand numbers has never mattered more. How can we more effectively translate numbers and stats - so fundamental to the next big idea - to make data come to life? Drawing on years of research into making ideas stick, Chip Heath and Karla Starr outline six critical principles that will give anyone the tools to communicate numbers with more transparency and meaning. Using concepts such as simplicity, concreteness and familiarity, they reveal what's compelling about a number and show how to transform it into its most engaging form.",
