          "description": "A unique and beautiful gift book celebrating the art of Jim Kay -- 366 magical moments from J.K Rowling's Harry Potter novels, evoked in spellbinding brushstrokes, characterful ink work, and illuminating pencil sketches. This irresistible gift book takes readers on an unforgettable journey through the seasons at Hogwarts. Jim Kay's captivating illustrations, paired with much-loved quotations from J.K. Rowling's Harry Potter novels -- one moment, anniversary, or memory for every day of the year -- bring to life all of the magic, beauty, and wonder of the wizarding world. Jim Kay has been enchanting readers since the publication of the Illustrated Edition of Harry Potter and the Sorcerer's Stone in 2015. Now, in Harry Potter: A Magical Year, a selection of Kay's most iconic illustrations are joined by previously unseen pencil sketches and preparatory pieces, offering unique and fascinating insight into the artist's sketchbook. From the snowy towers of Hogwarts, to the dancing eyes of Professor Albus Dumbledore, to the hustle and bustle of Diagon Alley, this visual feast is the perfect companion for readers of all ages, at any point on their Harry Potter journey, and a gift to cherish for years to come.",
