          "subtitle": "Disrupting 10 Literacy Myths",
          "authors": [
            "Christine H. Leland",
            "Mitzi Lewison",
            "Jerome C. Harste"
          ],
          "publisher": "Routledge",
          "publishedDate": "2020-07-16",
          "description": "Accessible and engaging, this methods textbook provides a roadmap for improving reading instruction. Leland, Lewison, and Harste explain why certain ineffective or debunked literacy techniques prevail in the classroom, identify the problematic assumptions that underly these popular myths, and offer better alternatives for literacy teaching. Grounded in a mantra that promotes critical thinking and agency—Enjoy! Dig Deeply! Take Action!—this book presents a clear framework, methods, and easy applications for designing and implementing effective literacy instruction. Numerous teaching strategies, classroom examples, teacher vignettes, and recommendations for using children’s and adolescent literature found in this book make it an ideal text for preservice teachers in elementary and middle school reading, and English language arts methods courses as well as a practical resource for professional in-service workshops and teachers. Key features include: Instructional engagements for supporting students as they read picture books, chapter books, and news articles, and interact with social media and participate in the arts and everyday life; Voices from the field that challenge mythical thinking and offer realworld examples of what effective reading and language arts instruction looks like in practice; Owl statements that alert readers to key ideas for use when planning reading and language arts instruction.",
