          "description": "The chapters in this captivating volume demonstrate the importance and power of design and the ubiquitous and forceful effects it has on human life within the study of anthropology. The scholars explore the interactions between anthropology and design through a cross-disciplinary approach, and while their approaches vary in how they specifically consider design, they are all centered around the design-and-anthropology relationship. The chapters look at anthropology for design, in which anthropological methods and concepts are mobilized in the design process; anthropology of design, in which design is positioned as an object of ethnographic inquiry and critique; and design for anthropology, in which anthropologists borrow concepts and practices from design to enhance traditional ethnographic forms. Collectively, the chapters argue that bringing design and anthropology together can transform both fields in more than one way and that to tease out the implications of using design to reimagine ethnography—and of using ethnography to reimagine design—we need to consider the historical specificity of their entanglements.",
